  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div>
      <ResponsiveGridLayout className="layout" layouts={his.props.layout}
        breakpoints={{lg: 1200, md: 996, sm: 768, xs: 480, xxs: 0}}
        cols={{lg: 12, md: 10, sm: 6, xs: 4, xxs: 2}}>          {
            this.props.layout.map(x => {
              return <div key={x.i}>{x.i}</div>
            })
          }
        </ResponsiveGridLayout>
      </div>
    )
  }
}
